var nlNL={messages:{"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'":"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'","A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.":"A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.","Allow":"Toestaan","Allow in your wallet":"Toestaan in je portemonnee","Allow {symbol} first":["Sta eerst ",["symbol"]," toe"],"Allowance pending":"Toelage in behandeling","An error occurred when trying to execute this swap. You may need to increase your slippage tolerance. If that does not work, there may be an incompatibility with the token you are trading. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Er is een fout opgetreden bij het uitvoeren van deze swap. Mogelijk moet u uw sliptolerantie verhogen. Als dat niet werkt, is er mogelijk een incompatibiliteit met het token dat u verhandelt. Let op: kosten voor overdracht en rebase tokens zijn niet compatibel met Uniswap V3.","Approval pending":"In afwachting van goedkeuring","Approve":"Goedkeuren","Approve Permit2":"Approve Permit2","Approve in your wallet":"Goedkeuren in uw portemonnee","Approve {0} for trading":["Approve ",["0"]," for trading"],"Approve {symbol} first":["Eerst ",["symbol"]," goedkeuren"],"Auto":"Automatisch","Auto Router":"Automatische router","Auto Router API":"Auto Router API","Balance:":"Saldo:","Best price route costs {0} in gas. Your price is optimized by considering split routes, multiple hops, and gas costs.":["Best price route costs ",["0"]," in gas. Your price is optimized by considering split routes, multiple hops, and gas costs."],"Cancel":"Cancel","Close":"Sluiten","Confirm in your wallet":"Bevestig in je portemonnee","Confirming approval":"Confirming approval","Connect to {0}":["Connect to ",["0"]],"Connect wallet":"Verbind portemonnee","Connecting…":"…. aansluiten","Continue":"Continue","Convert {0} to {1}":["Converteren ",["0"]," naar ",["1"]],"Convert {0} to {1} with no slippage":["Convert ",["0"]," to ",["1"]," with no slippage"],"Disconnect wallet":"Portemonnee ontkoppelen","Dismiss":"Afwijzen","Enter an amount":"Voer een bedrag in","Error fetching trade":"Fout bij ophalen van handel","Exchange rate":"Exchange rate","Expected output":"Expected output","Fetching best price…":"Beste prijs ophalen…","Get support":"Get support","Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.":"Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.","High slippage increases the risk of price movement":"Hoge slippen verhoogt het risico van prijsbewegingen","I don't have a wallet":"Ik heb geen portemonnee","Insufficient liquidity":"Insufficient liquidity","Insufficient {0} balance":["Onvoldoende saldo ",["0"]],"Invalid recipient":"Ongeldige ontvanger","Max":"Max.","Max slippage":"Max slippen","Maximum input after slippage":"Maximum input after slippage","Minimum output after slippage":"Minimum output after slippage","Missing dependencies":"Ontbrekende afhankelijkheden","Network fee":"Netwerkkosten","No results found.":"Geen resultaten gevonden.","No tokens are available on this network. Please switch to another network.":"Er zijn geen tokens beschikbaar op dit netwerk. Schakel over naar een ander netwerk.","Order routing":"Order routing","Output is estimated. You will receive at least {minReceivedString} or the transaction will revert.":["Output is estimated. You will receive at least ",["minReceivedString"]," or the transaction will revert."],"Output is estimated. You will send at most {maxSentString} or the transaction will revert.":["Output is estimated. You will send at most ",["maxSentString"]," or the transaction will revert."],"Permit2 allows safe sharing and management of token approvals across different smart contracts.":"Permit2 allows safe sharing and management of token approvals across different smart contracts.","Permit2 approval failed":"Permit2 approval failed","Please enter a valid slippage %":"Vul a.u.b. een geldig slippage % in","Powered by the Uniswap protocol":"Aangedreven door het Uniswap-protocol","Price impact":"Prijsimpact","Price updated":"Prijs bijgewerkt","Reload":"Reload","Reload the page":"Herlaad de pagina","Request rejected":"Request rejected","Review swap":"Review swap","Search by token name or address":"Zoeken op tokennaam of adres","Select token":"Select token","Show less":"Show less","Show more":"Show more","Something went wrong":"Er is iets fout gegaan","Sorry, an error occured while processing your request. Please try again or contact support.":"Sorry, an error occured while processing your request. Please try again or contact support.","Success":"Succes","Swap":"Wisselen","Swap failed: {0}":["Wissel mislukt: ",["0"]],"Switch network":"Van netwerk wisselen","Switch network in your wallet":"Wissel van netwerk in je portemonnee","Switching network":"Wisselend netwerk","Test Title":"Test Title","The Uniswap invariant x*y=k was not satisfied by the swap. This usually means one of the tokens you are swapping incorporates custom behavior on transfer.":"Aan de Uniswap-invariant x * y = k werd door de swap niet voldaan. Dit betekent meestal dat een van de tokens die u ruilt, aangepast gedrag bij overdracht bevat.","The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.":"The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.","The estimated difference between the USD values of input and output amounts.":"The estimated difference between the USD values of input and output amounts.","The fee paid to miners to process your transaction. This must be paid in ETH.":"The fee paid to miners to process your transaction. This must be paid in ETH.","The impact your trade has on the market price of this pool.":"The impact your trade has on the market price of this pool.","The input token cannot be transferred. There may be an issue with the input token.":"De input-token kan niet worden overgedragen. Er is mogelijk een probleem met de input-token.","The network is confirming your Permit2 approval before you can swap.":"The network is confirming your Permit2 approval before you can swap.","The output token cannot be transferred. There may be an issue with the output token.":"De output-token kan niet worden overgedragen. Er is mogelijk een probleem met de output-token.","The output token cannot be transferred. There may be an issue with the output token. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"De output token kan niet worden overgedragen. Er is mogelijk een probleem met de output token. Let op: kosten voor overdracht en rebase tokens zijn niet compatibel met Uniswap V3.","There will be a large difference between your input and output values due to current liquidity.":"There will be a large difference between your input and output values due to current liquidity.","This error was prompted by denying a request in your wallet.":"This error was prompted by denying a request in your wallet.","This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.":"This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.","This transaction will not succeed due to price movement. Try increasing your slippage tolerance. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Deze transactie zal niet slagen vanwege prijsbewegingen. Probeer uw slippage tolerantie te vergroten. Let op: kosten voor overdracht en rebasetokens zijn niet compatibel met Uniswap V3.","This transaction will not succeed either due to price movement or fee on transfer. Try increasing your slippage tolerance.":"Deze transactie zal niet slagen vanwege prijsbewegingen of kosten bij overdracht. Probeer uw slipping tolerantie te vergroten.","This transaction will result in a":"This transaction will result in a","Transaction deadline":"Transactiedeadline","Transaction rejected":"Transactie afgewezen","Transaction submitted":"Transactie ingediend","Try again":"Try again","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Probeer uw sliptolerantie te vergroten.<0/>OPMERKING: Kosten voor overdracht en rebase-tokens zijn niet compatibel met Uniswap V3.","Unexpected error. Could not estimate gas for the swap.":"Onverwachte fout. Kon het gas voor de swap niet schatten.","Unexpected issue with estimating the gas. Please try again.":"Onverwacht probleem met het schatten van het gas. Probeer het opnieuw.","Use the Uniswap Labs API to get faster quotes.":"Use the Uniswap Labs API to get faster quotes.","View on Etherscan":"Bekijk op Etherscan","Wallet disconnected":"Wallet disconnected","Warning":"Waarschuwing","You pay":"You pay","You receive":"You receive","Your swap failed.":"Your swap failed.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"Uw transactie wordt teruggedraaid als deze langer dan deze periode in behandeling is geweest.","Your transaction will revert if the price changes unfavorably by more than this percentage.":"Uw transactie zal terugdraaien als de prijs onvoordelig met meer dan dit percentage verandert.","minutes":"minuten","price impact on the market price of this pool. Do you wish to continue?":"price impact on the market price of this pool. Do you wish to continue?","{0} approval failed":[["0"]," approval failed"],"{0} {1}":[["0"]," ",["1"]],"{0}. Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3.":[["0"],". Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3."],"{caption}":[["caption"]],"{integrator} fee":[["integrator"]," kosten"],"{symbol} permit allowance failed: {0}":[["symbol"]," permit allowance failed: ",["0"]],"{symbol} token allowance failed: {0}":[["symbol"]," token allowance failed: ",["0"]],"{title}":[["title"]]}};

